import React from 'react';
import web from '../src/images/welc.gif';
import backg1 from '../src/images/backg1.jpg';
import Common from './Common';

const Home = () => {
  return (
    <>
    <div className='backg1'>{backg1}</div>
    <Common name= 'Grow your business'  
        imgsrc={web}
        visit= '/Services'
        btname= "Get Started"
      />
    </>
  )
};

export default Home;
